INSERT INTO `reviews` VALUES (1,31,1,'Одно слово - восхитительно','Уверен, каждому знакомо это великолепное чувство. Когда чего-либо очень долго ждёшь. И вот настал этот момент. У тебя невероятно высокие ожидания, на секунду проскальзывает мысль «А что если все эти ожидания были напрасны? Что если такие ожидания невозможно оправдать и ты выйдешь расстроенный?». А потом это событие превосходит твои ожидания. Ты сидишь с открытым ртом и ничего не можешь сказать.  Я ждал этот фильм сильнее всего в этом году. Как огромный фанат Нолана, могу сказать что фильм великолепен. В нём как будто бы есть всё, за что я обожаю этого режиссёра: и великолепный визуал, и масштаб съёмок, и великолепный подбор актёров, и игра с цветом фильма, и несколько ветвей повествования, и основной посыл фильма, и невероятная концовка.  Это история об Американском Прометее. Это написано в названии книги 2005 года, по которой снят фильм. Это говорится и в самом фильме.','2024-04-09 02:36:53'),(10,32,3,'Да норм фильм вы че!!','Мне понравилось','2024-04-10 04:25:38'),(13,32,2,'Далёкое будущее и недалёкое настоящее','Мини-сериал \'Чёрное Зеркало\' удивляет с первых минут. Это не три серии - это три совершенно разных кинокартины, причём, вторая вполне может считаться полноценным кинофильмом. Три никак не связанных между собой сюжета, три блестяще составленных сценария, почти три часа интереснейшего видео.\n\nО чём же, собственно, сам сериал? С моей точки зрения, далеко не о пагубном влиянии технологий на человека. Здесь нет какой-либо морали, нет каких-то определённых концовок, толкающих к каким-либо серьёзным выводам, нет даже какой-то наставляемой зрителю позиции. Дело режиссёра здесь - просто отстранённо показать происходящее со стороны. И он прекрасно справился с задачей.\n\n1 серия.\n\nДавление общественности... Насколько влиятельнее становятся массы вместе с популяризацией социальных сетей, твиттера и интернет-сообществ? До чего же странные решения придётся принимать власти во имя \'гуманности\' и \'демократии\'? В данной картине эта тема раскрыта довольно интересно и глубоко. Отличное начало, отличная концовка.\n\n9 из 10\n\n2 серия.\n\nТехнологии будущего, а люди всё те же. Людям, не по наслышке знакомым с продукцией Apple, кинектами и прочими новыми технологиями, будет смотреть ещё интереснее. Но картина совсем не об этом. Она о человеке, об отчаянии, об одиночестве и о его последствиях. Не хотелось бы вдаваться в подробности, дабы не портить потенциальным зрителям просмотр лучшей серии проекта. Блестяще проработано и продумано всё до мельчайших деталей и мелочей, некоторые из которых не замечаешь при первом просмотре. Это восхитительно.\n\n10 из 10\n\n3 серия.\n\nИнтересные фантазии на тему чипов-имплантов. Довольно популярная тема в наше время, и здесь раскрыта довольно неплохо. Очень хорошо проработан каждый диалог и каждая фраза; всё выглядит на удивление живо и реалистично. Внедрение новых технологий внесло, казалось бы, существенных вклад в их жизнь, но ничего не изменилось -- всё так же, как и в нашем мире.. Технологии воспроизведения памяти лишь раздувают огонь непонимания и дают новый простор для непродуктивного времяпрепровождения.\n\n9 из 10\n\n---\n\nЯ бы не назвал \'Чёрное Зеркало\' сериалом. Здесь нет сюжета, развития, нет привязки к персонажам. Перед нами просто нейтральный взгляд на людей через призму будущего и настоящего. Технологии меняются. Люди не меняются.\n\n9.5 из 10','2024-04-10 05:16:16'),(14,34,3,'Адски переоценен','\nФильм абсолютно невнятное говно без какого-либо акта. За два с половиной часа не произошло вообще ничего. Я понимаю, что это некое интро и дальше в сиквелах будет развитие, но я платил за полный фильм, а получил какое-то жалкое введение ни о чем. Главный герой типичная \'Мэри Сью\', у него все идеально получается, он со всем справляется, красавчик ну и вообще идеален.\n\nЗа весь фильм буквально пара сцен, где хоть что-то происходит, но обе сцены не вызывают напряжение просто из-за того что тебе как зрителю абсолютно все равно на главного героя и его отца, потому что персонажи абсолютно не раскрыты.\n\nФильм может понравится двум типам людей: фанатам книги и дурачкам, которые боятся, что если они скажут что не поняли фильм, то на них будут косо смотреть. Получается ситуация как в книге про голого короля, когда одним нравится потому что они уже фанаты, а другие поддакивают боясь, что они не поняли потому что глупые.\n\nКартинка, звук, атмосфера безусловно прекрасны, идеальный фильм для скриншотов. Прекрасный подбор актеров. Но кино это не картинка на тамблере, а в первую очередь сюжет.\n\nВсе отмазы фанатов, что вселенная просто слишком большая это просто попытка оправдать импотенцию сценариста. Гарри Поттер тоже несколько томов имеет, однако какой бы фильм ты не сел смотреть тебе сразу будут понятны персонажи и их мотивация. Та же история со звездными войнами или фильмами Марвел. Там тоже огромные вселенные, однако можно будучи полным профаном сесть за любой фильм и начать сопереживать персонажам, потому что они там не бездушные куклы с очень претенциозным лицом без какого-либо контекста.\n\nФильм максимально скучный и состоит по большей части из воды и несвязанных друг с другом сцен. Я люблю спокойное кино без экшена. Но оно бывает качественным, вроде какого-нибудь “Однажды в Голливуде”, когда нам два часа медленно раскрывают персонажей, которые выстреливают в последние минуты фильма, а бывает подобное “кино”, которое просто ни о чем.\n\nМожет быть когда выйдет 10 сиквелов и картина будет полностью завершена это все сложится в один большой пазл, но сегодня это просто распиаренный АСМР ролик для сна в кинозале.','2024-04-10 15:23:37'),(22,34,1,'Представление личности','Хех. Кино конечно об атомной бомбе, но в целом и в частности больше о самом создателе. Так сказать, художественное представление личности в рамках американского блокбастера. Пока смотрел, накидал каких-то тезисных заметок, которые сейчас и вывалю.\n\nНолан по Дюнкерку уже показал историческую вольность, ради художественного представления. И известен он во многом фантастическими фильмами. По этому, наверное не стоило ждать какого-то сухого байопика с чёткой и последовательной исторической достоверностью.\n\nСквозной линией - процесс об отлучении Оппенгеймера от гос. тайны, под предлогом его связи с коммунистами в 30-х. Для США коммунизм всегда был хуже фашизма. И это выглядит основным мотивом.\n\nЕстественно развлекательное кино не может быть только о физике. По этому нам покажут секс под санскрит о разрушении миров. Тема сисек раскрыта.\n\nНаучпоп, гений и его бабы и объяснения, что Оппенгеймер не коммунист, а боролся против равнодушия правительства и интриг, за боль своего еврейского народа, ради науки и естественно во благо Америки.\n\nДалее, проблемы в семье из-за хреновой жены. Чего ещё ждать от коммунистки? Да и вообще, от неё одни проблемы. Пока правительству было нужно, о коммунистическом прошлом особо не думали, потом вдруг это стало проблемой.\n\nЕщё нам покажут процесс создания атомной бомбы, под воодушевляющую музыку. Ещё одна навязчивая интрига фильма, это слил ли Оппенгеймер инфу коммунистам, из-за чего СССР в итоге сделали свою ядерную бомбу. Иначе, сами бы они такое, конечно же никогда не смогли.\n\nДовольно долгое блевотное оправдание планов бомбить Японию ядерной бомбой, во благо даже самих японцев. Самое отвратительное, что при абсолютно здравой и аргументированной риторики, любые мнения могут меняться кардинально. И сбрось СССР бомбу на Японию, то отношение было бы совершенно другим. Исторически всем известно, что США поощряют уничтожение мирного населения, ради достижения целей. Однополярная идеология и двойные стандарты. То что сейчас, было нормой всегда. Да и чего греха таить, есть и у всех.\n\nЕщё мы увидим триллер с испытаниями ядерной бомбы и чёрный юмор, о том что теоретически были шансы уничтожить атмосферу Земли с всеобщим психопатически радостным экстазом в финале.\n\nНо ещё покажут психологические переживания человека, создавшего супер оружие, унёсшее жизни более 100 тысяч человек. И этого в фильме много, и это хорошо. Психологизм переживаний в финале выстрелил сильно. Причём разумными кажутся даже высказывания главного злодея. Небольшое просветление, что виноваты политики, а не учёные. А потом, когда давление на Оппенгеймера усилилось, при том, что он пытался сделать всё, сто бы снизить мировое напряжение научной открытостью, наверное как-то раскрыло характер, в положительную сторону человечности. Короче, получился заблудший святой. Падший, но ангел.\n\nНебольшое заигрывание с либерализмом, что всему виной политики-карьеристы, которые помешали Оппенгеймеру продолжать свою миротворческую деятельность. Будто эти политики исключение, а не нечто естественное для американской власти. И герой Дауни младшего, будто единственный суперзлодей. Потом ещё сказали, что американские коммунисты думали, что они не советские. В итоге, Оппенгеймера не уничтожили, но выкинули на свалку.\n\nКак офтоп, инфа. На самом деле достаточно людей сбегало из США в СССР, как раз из-за такой агрессивной политики давления, относительно своих соотечественников.\n\nНо финал очень хороший. Замечательный небольшой диалог Оппенгеймера и Энштейна и отличные слова о цепной реакции, которую запустили и которая разрушит весь мир. Это зацепило. Ну и благодаря такому финалу, мне фильм понравился намного больше Дюнкерка.\n\nКак итог: кино хорошее, музыка замечательная, сюжет интересный, динамика есть, мысли есть, Мёрфи и Дауни молодцы, финал замечательный, Нолан красавчик. Фильм отхватил почти всех главных Глобусов: лучший фильм, лучшая главная роль Мерфи, лучшая второстепенная роль Дауни, лучший режиссёр Нолан и лучший саундтрек написанный Людвигом Йоранссоном.','2024-04-10 16:03:39'),(27,36,1,'мяу мяум муямуя','мяу мяу','2024-04-11 04:55:04'),(28,36,2,'мяу','мяу мяу','2024-04-11 04:55:16');
